                        Get In Touch
                    </Text>
                </Header>
                <Form>
                    <FullName>
                        <Name >
                            <Input placeholder={'First Name'}/>
                        </Name>
                        <Name>
                            <Input placeholder={'Last Name'}/>
                        </Name>
                    </FullName>
                    <Email>
                        <Input placeholder={'Email'}/>
                    </Email>
                    <Message>
                        <Textarea placeholder={'Message'}></Textarea>
                    </Message>
                    <Button>
                        Submit
                    </Button>
                </Form>
            </Container>
        </Section>

    )
}

export default Contact

